def leer_archivo(archivo_ext):
    """
    esta función me lee cualquier archivo y me retorna toda la info
    :param archivo_ext: es el archivo txt que tiene toda la info de los srts
    :return: el diccionario con todas las variables de configuracion
    contenido_arch
    """
    filepath = "CSV_FILES\\"
    archivo_ext = filepath + archivo_ext
    with open(archivo_ext, "r") as arch:
        contenido_arch = arch.read()
        """
        lo que tengo ahora es un string que me lee del archivo. 
        voy a pasar ese string a variable con la intruccion eval
        """
        contenido_arch = eval(contenido_arch)
        #print(contenido_arch)
    return contenido_arch

